import Note from "./components.js"

const App = ({notes}) => {

  return (
    <div>
      <h1>Notes</h1>
      <ul>
        {notes.map((note,i) => 
        <Note note={note} key={note.id}></Note>
        )}
      </ul>
    </div>
  )
}

export default App
